import Camposerviço from "../Camposerviço";
import { FaRegCheckCircle ,FaCog, FaExclamation } from "react-icons/fa"
const Serviços = () => {
    return ( <>
        <div className="container-serviços">
            <h3>Serviços</h3>
            <Camposerviço  serviço ="SacDigital" icone={<FaRegCheckCircle className="check-icon" />}/>
            <Camposerviço serviço ="Panfleto Online"  icone={<FaRegCheckCircle className="check-icon" />}/>
            <Camposerviço serviço ="SMSIdeal"   icone={<FaRegCheckCircle className="check-icon" />}/>
            <Camposerviço serviço ="Consulta Ideal" icone={<FaCog className="maintence-icon"/>}/>
            <Camposerviço serviço ="WhatsApp" icone={<FaExclamation className="alert-icon"/>}/>
            <Camposerviço serviço ="WhatsApp Business" />
        </div>

        </>
     );
}
 
export default Serviços;
